  false,\n\t\"url\": null,\n\t\"notes\": \"The Principal Port file contains USACE
  port codes, geographic locations (longitude, latitude), names, and commodity tonnage
  summaries (total tons, domestic, foreign, imports and exports) for Principal USACE
  Ports. The ports are politically defined by port limits or Corps projects, excluding
  non-Corps projects not authorized for publication. The determination for the published
  Principal Ports is based upon the total tonnage for the port for the particular
  year; therefore the top 150 list can vary from year to year. The port facilities
  feature describes the physical and inter-modal (infrastructure) characteristics
  of the California coastal ports of the United States. The feature includes, but
  is not limited to location (latitude/longitude, waterway, mile, and bank); operations
  (name, owner, operator, purpose, handling equipment, rates, and details of open-and-covered
  storage facilities); type and dimension of construction (length of berthing space
  for vessels and/or barges, depth, apron width, deck elevation, and details of rail-and-highway
  access); and utilities available (water, electricity, and fire protection).\",\n\t\"license_title\":
